import React from 'react';

import { LanguageContext } from '../../context/LanguageContext';
import './Faq.css';

class Faq extends React.Component {

    static contextType = LanguageContext;

    render() {
        let faqData = this.context.faq,
            generalData = faqData.categories.general,
            tokensData = faqData.categories.tokens,
            clientData = faqData.categories.client,
            legalData = faqData.categories.legal;

        return(
            <section id="faq">
                <div className="container">
                    <div className="content-title">
                        <h2>{faqData.title}</h2>

                        <div className="separator">
                            <div className="large"></div>
                            <div className="medium"></div>
                            <div className="small"></div>
                        </div>
                    </div>

                    <div className="content">
                        <div className="content-data">
                            <div className="categories">
                                <a className="category active" href="#general">{generalData.title}</a>
                                <a className="category" href="#tokens">{tokensData.title}</a>
                                <a className="category" href="#client">{clientData.title}</a>
                                <a className="category" href="#legal">{legalData.title}</a>
                            </div>

                            <div className="questions">
                                <div id="general"></div>
                                <div id="tokens"></div>
                                <div id="client"></div>
                                <div id="legal"></div>
                            </div>
                        </div>
                    </div>
                </div>
            </section>
        );
    }
}

export default Faq;
